import React from "react";
import ReactDom from 'react-dom/client';
import Intro from './components/comp1/comp1.js';
import Buttons from './components/Buttons/index.js';
import Display from "./components/Display/index.js";
function App() {
    return(
        <>
        <Display/>
        <Buttons/>
        </>   
    );
}
const root = ReactDom.createRoot(document.getElementById("calc"));
root.render(
    <App />
);
